import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import logo from "../../images/logo.png";
import "./NavBar.css";

function NavBar() {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const navigate = useNavigate();

  const handleClickLogo = () => {
    navigate("/");
  };

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <nav className="bg-gray-800">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 h-20 flex items-center">
        <div className="logo-container flex-grow flex justify-center">
          {/* Logo */}
          <Link to="/" onClick={handleClickLogo}>
            <img src={logo} alt="Logo" className="main-logo" />
          </Link>
        </div>

        {/* Dropdown Button */}
        <div className="dropdown-container">
          <button onClick={toggleDropdown} className="dropdown-button">Grids</button>
          {isDropdownOpen && (
            <div className="dropdown-menu">
              <div className="dropdown-item">Today</div>
              {/* Map your items here */}
              {['03-15-2024', '03-16-2024',].map((item, index) => (
                <div key={index} className="dropdown-item">{item}</div>
              ))}
            </div>
          )}
        </div>
      </div>
    </nav>
  );  
}

export default NavBar;
